import React from "react";

function ThanksModal() {
  return (
    <div className="fixed inset-0 z-30 bg-black/75 grid place-items-center">
      <div className="flex flex-col text-white items-center justify-center">
        <p className="text-[50px]">THANK YOU!</p>
        <button className="w-[292px] h-[62px] bg-[#A7AE45] rounded-[10px] text-[24px] font-family font-medium mt-3">
          Create Another Review
        </button>
      </div>
    </div>
  );
}

export default ThanksModal;
